import React from 'react'

function Login({ onLogin }) {
    const handleLogin = () => {
      // Perform login logic
      onLogin();
    };

return (
    <div>
      <h1>Login</h1>
      <button onClick={handleLogin}>Login</button>
    </div>
  );
}

export default Login;
